import React from "react";
import eu from "../assets/Novo Projeto.png";

const Intro = () => {
  return (
    <div className="sem0bg" id="Intro">
      <div className="imgintro">
        <div>
            <h2>teset</h2>
        </div>
        <div>
            <img src={eu}/>
        </div>
      </div>
    </div>
  );
};

export default Intro;
